import React, { useEffect } from "react";
import KakaoMapScript from "../../util/kakaoMapScript";

const Coffee = () => {
  useEffect(() => {
    KakaoMapScript();
  }, []);

  return (
    <div
      id="myMap"
      style={{
        width: "800px",
        height: "700px",
      }}
    ></div>
  );
};

export default Coffee;
